// Login.js
import React from 'react';
import { Link, useNavigate} from 'react-router-dom'



function Login() {
    const navigate = useNavigate();

    const handleLogin = () => {
      // Perform login logic
      // Example: Redirect to home page after login
      navigate('/');
    };

  return (
    <div>
    <button onClick={handleLogin}>Login</button>
    </div>
  );
}

export default Login;
